column8:
　デイパックやランドセルごとすっぽりとかぶることができるポンチョです。育ち盛りの子どもでも、成長に合わせたフィッティングを行えるよう、すそ部分には丈の長さを調節できるホックを設けています。また、手首部分に備えたループに手を通せば、袖口をぴったりと固定でき、万が一の転倒の際にも、地面に手をつく動作を妨げません。軽量・コンパクトに収納できるので、通学やハイキングへの携行にも大変便利です。<br>


■カラー：SV(シルバー)、CHARS(シャルトルーズ)<br>

■サイズ：125-155<br>

■素材：ハイドロプロ(R)2レイヤー[表/40デニール・ナイロン・リップストップ]<br>

■平均重量：250g<br>

<br>
<br>
